import "../../styles/components/lines.css"
import { LineChart, Line , XAxis , YAxis , Tooltip ,ResponsiveContainer} from "recharts";

function Lines ({input}) {

    return input && (
        <ResponsiveContainer className="lines_body" width="30%" height={300}>
            <LineChart data={input}>
                <XAxis dataKey="day" />
                <YAxis dataKey="sessionLength" />
                <Tooltip />
                <Line type="monotone" dataKey="sessionLength" stroke="white" strokeWidth={3} dot={false} activeDot={{stroke:'white',strokeWidth:2,r:10}} />
            </LineChart>
        </ResponsiveContainer>
    )
}

export default Lines
